import ReactMapGL from 'react-map-gl'
import React, {Component} from 'react'
import './MostPopular.css'
import MapGL, {NavigationControl} from 'react-map-gl';

const TOKEN = 'pk.eyJ1Ijoic2VqbGFhbGkiLCJhIjoiY2p5MGdmcGUxMDJ1eDNsbGV4czBod2wxZCJ9.oXQmFa0BWv9YkBlP6zCKCA'

const navStyle = {
    position: 'absolute',
    top: 0,
    left: 0,
    // padding: '10px'
  };

class MostPopular extends Component {
   constructor() {
       super()
       this.state = {
           viewport: {
               latitude: 42.6026344,
               longitude: 20.902977,
               zoom: 5.5,
               bearing: 200,
               pitch: 0,
               width: 500,
               height: 400,
            },
            popupInfo: null
        };
    }

render() {
    const {viewport} = this.state;

    return (
        <div  id="map" style={{backgroundColor: "white"}}>
            <h1>this is most popular page</h1>
            <MapGL style={{width: "100%"}}
        {...viewport}
        mapStyle="mapbox://styles/mapbox/light-v9"
        mapboxApiAccessToken={TOKEN}>
        <div className="nav" style={navStyle}>
          <NavigationControl/>

        {/* <Pin longitude={} latitude={} offsetTop={} offsetLeft={}/> */}
        </div>
      </MapGL>
</div>
    )
}
}

export default MostPopular
